import styles from './SearchForm.module.scss';

const SearchForm = () => {
    return (
        <SearchForm>
            <TextInput>Search...</TextInput>
            <Button><span className="fa fa-search" /></Button>
        </SearchForm>
    );
};

export default SearchForm;
